// RouteFinder.js
import React, { useState, useEffect } from 'react';
import Planet from '../Planet/planet.js';
import './RouteFinder.css';

function RouteFinder() {
  const [fromPlanet, setFromPlanet] = useState('');
  const [toPlanet, setToPlanet] = useState('');
  const [mode, setMode] = useState('selecting');
  const [routes, setRouteInfo] = useState([]);
  const [displayLimit, setDisplayLimit] = useState(5);

  useEffect(() => {
    if (fromPlanet && toPlanet) {
      setMode('selected');
    } else if (fromPlanet) {
      setMode('deselected');
    } else {
      setMode('selecting');
    }
  }, [fromPlanet, toPlanet]);

  const handlePlanetClick = (planet) => {
    if (mode === 'selecting') {
      setFromPlanet(planet);
    } else if (mode === 'deselected') {
      setToPlanet(planet);
    } else if (mode === 'selected') {
      return;
    }
  };

  const validateForm = (event) => {
    event.preventDefault();

    if (event.nativeEvent.submitter.type === 'submit') {
      if (fromPlanet === '' || toPlanet === '') {
        alert('Please select a planet for both Origin and Destination.');
        return;
      }

      if (fromPlanet === toPlanet) {
        alert('From and To locations cannot be the same planet.');
        setToPlanet('');
        return;
      }

      searchRoutes();
    }
  };

  const handleClearClick = (id) => {
    setFromPlanet('');
    setToPlanet('');
  };

  const searchRoutes = () => {
    const apiURL = process.env.REACT_APP_BACKEND_API_URL;
    const url = apiURL + `/api/FlightFinder?startLoc=${fromPlanet}&endLoc=${toPlanet}`;

    fetch(url)
      .then((response) => response.json())
      .then((data) => {
        setRouteInfo(data);
        setDisplayLimit(5);
        console.log(data);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  };

  const getPlanetClass = (planet) => {
    if (mode === 'selecting') {
      return '';
    } else if (mode === 'deselected') {
      if (planet === fromPlanet) {
        return 'planet-from';
      } else {
        return '';
      }
    } else if (mode === 'selected') {
      if (planet === fromPlanet) {
        return 'planet-from planet-selected';
      } else if (planet === toPlanet) {
        return 'planet-to planet-selected';
      } else {
        return 'planet-selected';
      }
    }
  };

  return (
    <div className="route-finder-container">
      <h1>Select an Origin and Destination planet, fellow alien!</h1>
      <form onSubmit={validateForm}>
        <div className="planet-container">
          <Planet planet="Mercury" className="planet-from" onClick={() => handlePlanetClick("Mercury")} />
          <Planet planet="Venus" className="planet-to" onClick={() => handlePlanetClick("Venus")} />

          <Planet planet="Earth" fromPlanet={fromPlanet} toPlanet={toPlanet} onClick={() => handlePlanetClick("Earth")} />
          <Planet planet="Mars" fromPlanet={fromPlanet} toPlanet={toPlanet} onClick={() => handlePlanetClick("Mars")} />
          <Planet planet="Jupiter" fromPlanet={fromPlanet} toPlanet={toPlanet} onClick={() => handlePlanetClick("Jupiter")} />
          <Planet planet="Saturn" fromPlanet={fromPlanet} toPlanet={toPlanet} onClick={() => handlePlanetClick("Saturn")} />
          <Planet planet="Uranus" fromPlanet={fromPlanet} toPlanet={toPlanet} onClick={() => handlePlanetClick("Uranus")} />
          <Planet planet="Neptune" fromPlanet={fromPlanet} toPlanet={toPlanet} onClick={() => handlePlanetClick("Neptune")} />
        </div>
        <div className="selected-planets">
          <p>Origin: {fromPlanet || ''}</p>
          <p>Destination: {toPlanet || ''}</p>
        </div>
        <div className="buttons">
          <span className="search-button" type="submit">Search</span>
          <span className="search-button" onClick={() => handleClearClick('to')}> Clear</span>
        </div>
      </form>
    </div>
  );
}

export default RouteFinder;
